import '../CSS/Card.css';
function Card(){

	return(
		<button className="Card-Border">
			<p className="Card-Text">
			You have not selected a country.
			</p>

			<p className="Card-Text">
			Please use the search bar above to make a selection.
			</p>

			<p className='Card-Text'>
			Or click on this card!
			</p>

		</button>
	);
}
export default Card;
